import "./App.css";
import ProductDisplay from "./components/ProductList";

import products from "./assets/products";

import { useCart } from "./Providers/Cart";

function App() {
  const { cart } = useCart();

  return (
    <>
      <div>
        <ProductDisplay list={products} variant={false} />
        <ProductDisplay list={cart} variant={true} />
      </div>
    </>
  );
}

export default App;
